import React, { Component } from "react";
import Calendar from "./Sidebar";

class Home extends Component {
  constructor(props) {
    super(props);
    console.log(this.props.events)
  }

  render() {

    this.first_object = (<div key={this.props.events[0].database_id}>
      <h1>{this.props.events[0].title}</h1>
      <h2>{this.props.events[0].date}</h2>
  </div>);

    return (
      <div>

        <p>The home page!</p>
        <Calendar events={this.props.events} />
      </div>
    );
  }
}

export default Home;
